import React from 'react';
import { ButtonGroup, ToggleButton } from 'react-bootstrap';

const ButtonOptions = () => {
  return (
    <ButtonGroup>
      <ToggleButton type="radio" name="options" value="1" defaultChecked>
        Active
      </ToggleButton>
      <ToggleButton type="radio" name="options" value="2">
        Radio
      </ToggleButton>
      <ToggleButton type="radio" name="options" value="3">
        Radio
      </ToggleButton>
    </ButtonGroup>
  );
};

export default ButtonOptions;
